import './ExpenseItem.css'

function ExpenseItem() {
    return (
      <div>
        <div>
            <div>March 28 2021</div>
            <div>
                <h2>
                   Car Insurance
                </h2>
                <p>$294.67</p>
            </div>
        </div>
        
      </div>
      
    );
  }
  
  export default ExpenseItem;
